<?php	require_once ("\../lib\\common\\dao\\VO.class.php");	class Timedimension extends VO {		private $timeid;		private $timetype;		private $intyear;		private $intmonth;		private $intweek;		private $intday;		public function setTimeid($timeid){			$this->timeid=$timeid;		}		public function getTimeid(){			return $this->timeid;		}		public function setTimetype($timetype){			$this->timetype=$timetype;		}		public function getTimetype(){			return $this->timetype;		}		public function setIntyear($intyear){			$this->intyear=$intyear;		}		public function getIntyear(){			return $this->intyear;		}		public function setIntmonth($intmonth){			$this->intmonth=$intmonth;		}		public function getIntmonth(){			return $this->intmonth;		}		public function setIntweek($intweek){			$this->intweek=$intweek;		}		public function getIntweek(){			return $this->intweek;		}		public function setIntday($intday){			$this->intday=$intday;		}		public function getIntday(){			return $this->intday;		}		public function __toString(){			return "timeid=".$this->timeid.", timetype=".$this->timetype.", intyear=".$this->intyear.", intmonth=".$this->intmonth.", intweek=".$this->intweek.", intday=".$this->intday;		}	}?>